    "2016-11-17T03:33:34.139757",nt"name": "usgs-national-elevation-dataset-ned-1-meter-downloadable-data-collection-from-the-national-map-",nt"isopen":
    false,nt"url": null,nt"notes": "This is a tiled collection of the National
    Elevation Dataset (NED) and is one meter resolution. Data in this layer represent
    a bare earth surface. The National Elevation Dataset (NED) serves as the elevation
    layer of The National Map, and provides basic elevation information for earth science
    studies and mapping applications in the United States. Scientists and resource managers
    use NED data for global change research, hydrologic modeling, resource monitoring,
    mapping and visualization, and many other applications. The NED is an elevation
    dataset that consists of seamless layers and non-seamless high resolution layers.
    Each of the seamless layers are composed of the best available raster elevation
    data of the conterminous United States, Alaska, Hawaii, territorial islands, Mexico
    and Canada. The NED is updated continually as new data become available. All NED
    data are in the public domain. The NED is derived from diverse source data that
    are processed to a common coordinate system and unit of vertical measure. The spatial
    reference used for tiles of the one meter layer within the conterminous United States
    (CONUS) is Universal Transverse Mercator (UTM) in units of meters, and in conformance
    with the North American Datum of 1983 (NAD83). All bare earth elevation values are
    in meters and are referenced to the North American Vertical Datum of 1988 (NAVD88).
    Each tile is distributed in the UTM Zone in which it lies. If a tile crosses two
    UTM Zones, it is delivered in both zones. Only source data of one meter resolution
    or finer are used to produce the NED standard one meter layer",nt"license_title":
